import './App.css';
import {BrowserRouter, Route, Routes} from "react-router-dom";
import Artwork from "./pages/artwork";

function App() {
  return (
      <BrowserRouter>
          <Routes>
              <Route path="/artwork/:id" element={<Artwork />}>

              </Route>
          </Routes>
      </BrowserRouter>
  );
}



export default App;
